import React, { useState, useEffect } from 'react';
import './Dashboard.css';

const Dashboard = () => {
  const [patients, setPatients] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [newPatient, setNewPatient] = useState({
    name: '',
    phone_number: '',
    patient_id: '',
    age: '',
    status: 'normal'
  });

  useEffect(() => {
    fetchPatients();
  }, []);

  const fetchPatients = async () => {
    try {
      const response = await fetch('http://localhost:8000/');
      const data = await response.json();
      setPatients(data);
    } catch (error) {
      console.error("Error fetching patients:", error);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewPatient(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Convert the form data to match the expected format
      const patientData = {
        ...newPatient,
        age: String(newPatient.age) // Convert age to string
      };

      const response = await fetch('http://localhost:8000/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(patientData)
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.detail || 'Failed to add patient');
      }

      await fetchPatients(); // Refresh the patient list

      // Reset form
      setNewPatient({
        name: '',
        phone_number: '',
        patient_id: '',
        age: '',
        status: 'normal'
      });
      setIsModalOpen(false);
    } catch (error) {
      console.error("Error adding patient:", error);
      alert(error.message); // Show error to user
    }
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Patient Dashboard</h1>
        <button className="add-patient-btn" onClick={() => setIsModalOpen(true)}>
          Add New Patient
        </button>
      </div>

      {isModalOpen && (
        <div className="modal-overlay">
          <div className="modal">
            <h3>Add New Patient</h3>
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label>Name:</label>
                <input
                  type="text"
                  name="name"
                  value={newPatient.name}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Phone Number:</label>
                <input
                  type="tel"
                  name="phone_number"
                  value={newPatient.phone_number}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Patient ID:</label>
                <input
                  type="text"
                  name="patient_id"
                  value={newPatient.patient_id}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Age:</label>
                <input
                  type="number"
                  name="age"
                  value={newPatient.age}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="modal-buttons">
                <button type="submit">Add Patient</button>
                <button type="button" onClick={() => setIsModalOpen(false)}>Cancel</button>
              </div>
            </form>
          </div>
        </div>
      )}

      <div className="patients-grid">
        {patients.map((patient, index) => (
          <div key={index} className="patient-card">
            <h3>{patient.name}</h3>
            <p>ID: {patient.patient_id}</p>
            <p>Age: {patient.age}</p>
            <p>Phone: {patient.phone_number}</p>
            <p>Status: {patient.status}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
